DROP TABLE League_squad;
CREATE TABLE League_squad(
Season VARCHAR(4),
LID VARCHAR(5),
Team VARCHAR(100),
Num VARCHAR(3),
Player VARCHAR(100),
Nation VARCHAR(5),
Position VARCHAR(5),
Height VARCHAR(10),
Weight VARCHAR(10),
Date_of_Birth DATE,
CONSTRAINT squadKey PRIMARY KEY(Season, LID, Player
	,Team, Date_of_Birth, Nation)
);



